import React from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './Header';


function App() {
    return (
        <div className="App">
            <Router>
                <Routes>
                    <Route exact path="/" element={<Header />}/>
                    <Route exact path="/login">
                        <div>
                            Log In
                        </div>
                    </Route>
                    <Route exact path="/signup">
                        <div>
                            Sign Up
                        </div>
                    </Route>
                </Routes>
            </Router>
        </div>
    );
}

export default App;
